import React, { useState, useEffect } from 'react';
import Navbar from '../../components/Admin/Navbar';
import SideNavbar from '../../components/Admin/sidenavbar';
import { Container, Row, Col } from 'react-bootstrap'; // Import Bootstrap components
import "./../../css/Admin/AdminPatient.css"

// Dummy data for testing
const dummyData = [
  { id: 1, firstName: 'John', lastName: 'Doe', phoneNo: 1234567890, email: 'john@example.com', role: 'ROLE_PATIENT', createdAt: '2024-02-23T10:00:00', createdBy: 'admin', otp: '123456', otpExpiry: '2024-02-23T12:00:00' },
  { id: 2, firstName: 'Jane', lastName: 'Doe', phoneNo: 9876543210, email: 'jane@example.com', role: 'ROLE_PATIENT', createdAt: '2024-02-23T11:00:00', createdBy: 'admin', otp: '654321', otpExpiry: '2024-02-23T13:00:00' }
];

const PatientTable = ({ data }) => {
  return (
    <table className="table">
      <thead>
        <tr>
          <th>ID</th>
          <th>First Name</th>
          <th>Last Name</th>
          <th>Phone Number</th>
          <th>Email</th>
          <th>Role</th>
          <th>Created At</th>
          <th>Created By</th>
          <th>OTP</th>
          <th>OTP Expiry</th>
        </tr>
      </thead>
      <tbody>
        {data.map(patient => (
          <tr key={patient.id}>
            <td>{patient.id}</td>
            <td>{patient.firstName}</td>
            <td>{patient.lastName}</td>
            <td>{patient.phoneNo}</td>
            <td>{patient.email}</td>
            <td>{patient.role}</td>
            <td>{patient.createdAt}</td>
            <td>{patient.createdBy}</td>
            <td>{patient.otp}</td>
            <td>{patient.otpExpiry}</td>
          </tr>
        ))}
      </tbody>
    </table>
  );
};

const AdminPatient = () => {
  const [patients, setPatients] = useState([]);

  // Simulate fetching data from API
  useEffect(() => {
    // You can fetch data from your backend API here
    // For now, we're using the dummy data
    setPatients(dummyData);
  }, []);

  return (
    <div>
      <Navbar />
      <div className="content">
        <div className="main-content">
          <SideNavbar />
          <Container fluid>
            <Row>
              <Col>
                <PatientTable data={patients} />
              </Col>
            </Row>
          </Container>
        </div>
      </div>
    </div>
  );
};

export default AdminPatient;
